import Home from './Home.js';
import './App.css';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Routes>
        <Home/>
      </Routes>
    </div>
  );
}

export default App;
